import React from "react";

const zipVal = "";

const Search = () => {
  return (
    <div>
      <InputGroup className="mb-3">
        <FormControl placeholder="Enter a zip code" aria-label="Zip Code" />
        <InputGroup.Append>
          <Button variant="outline-secondary">Search</Button>
        </InputGroup.Append>
      </InputGroup>
    </div>
  );
};

export default Search;
